import React from 'react'
import Link from 'next/link'
import Layout from './component/Layout'
import { PromoComp } from './component/PromoComp'
import { SlickComp } from './component/SlickComp'

type PostLinkProps = {
  title?: string
}

const PostLink: React.FunctionComponent<PostLinkProps> = ({ title }) => {
  return (
    <li>
      <Link href={`/post?title=${title}`}>
        <a>{title}</a>
      </Link>
    </li>
  )
}

const Pria: React.FunctionComponent = () => {
  const product = [{
    name:'Meja Belajar Minimalis',
    harga_lama: '300,000',
    harga_baru: '200,000',
    rating: '4',
    pict: 'https://s1.bukalapak.com/img/6079371563/s-194-194/Meja_Lipat_Set_Kursi___Meja_Belajar_Minimalis___Meja_Makan__.jpg'
},{
    name:'Speaker Aktif Portable',
    harga_lama: '610,000',
    harga_baru: '400,000',
    rating: '5',
    pict: 'https://s1.bukalapak.com/img/16920882461/s-194-194/data.jpeg'
},{
    name:'Lampu senter',
    harga_lama: '957,000',
    harga_baru: '800,000',
    rating: '3',
    pict: 'https://s1.bukalapak.com/img/68358989801/s-194-194/20190323_135938_Recovered.jpg'
},{
    name:'Pompa Galon Elektrik',
    harga_lama: '300,000',
    harga_baru: '150,000',
    rating: '4',
    pict: 'https://s0.bukalapak.com/img/57778233051/s-194-194/Pompa_Galon_Elektrik_Touch_Screen_Child_Lock_Water_Dispenser.jpg'
},{
    name:'Meja Komputer',
    harga_lama: '600,000',
    harga_baru: '400,000',
    rating: '4',
    pict: 'https://s0.bukalapak.com/img/51482781331/s-194-194/data.png.webp'
},{
    name:'Senter LED',
    harga_lama: '300,000',
    harga_baru: '200,000',
    rating: '4',
    pict: 'https://s1.bukalapak.com/img/68358989801/s-194-194/20190323_135938_Recovered.jpg'
}]
  return (
    <Layout title="Pria">
      <PromoComp 
        linkPromo='#'
        imageSrc='https://picsum.photos/id/26/1500/700'
        headTitle='Promo Pria'
        subTitle='Beli 2 Gratis 1'
        title="Berlaku sampai dengan 2020"
      />
      <SlickComp product={product} />
      <PostLink title="Hello Next.js" />
      <PostLink title="Learn Next.js is awesome" />
      <PostLink title="Deploy apps with Zeit" />
    </Layout>
  )
}
export default Pria
